const boxlinkData = [
    {
        id: 1,
        case: "Startseite",
        box: "square"
    },
    {
        id: 2,
        case: "Portfolio",
        box: "rectangle"
    },
    {
        id: 3,
        case: "Über Mich",
        box: "square"
    },
    {
        id: 4,
        case: "Kontakt",
        box: "square"
    },
]

export default boxlinkData
